import React from 'react';
import { Carousel } from 'react-bootstrap';
import '../styles/CategoryButtons.css';
import parrot1 from '../images/birds/parrot1.jpg'; // Import your images like this
import parrot2 from '../images/birds/parrot2.jpeg';
import dog2 from '../images/dogs/dog2.jpg';
import greenarowana1 from '../images/fishes/greenarowana1.jpeg';
import dog3 from '../images/dogs/dog3.jpg';

const CategoryButtons = () => {
  return (
    <div className="main-banner-container">
      {/* Carousel 1 */}
      <Carousel>
        <Carousel.Item>
          <img src={parrot1} alt="Parrot 1" className="carousel-image" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={parrot2} alt="Parrot 2" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 2 */}
      <Carousel>
        <Carousel.Item>
          <img src={dog2} alt="dog2" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 3 */}
      <Carousel>
        <Carousel.Item>
          <img src={greenarowana1} alt="greenarowana1.jpeg" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>

      {/* Carousel 4 */}
      <Carousel>
        <Carousel.Item>
          <img src={dog3} alt="dog3" className="carousel-image" />
        </Carousel.Item>
        {/* Add more items as needed */}
      </Carousel>
    
    </div>
  );
};

export default CategoryButtons;
